import React from "react";
import Search from "../../data/search.json";
const SearchList = (props) => {
  return (
    <div>
      <div>
        {Search.map((col, index) => (
          <div>
            <div>
              <img src={col.image_url} alt={Search.index} />
              <h2>{col.name}</h2>
              <p>{col.distance} form center</p>
              <p>{col.tag}</p>
              <h5>{col.description}</h5>
              <p>{col.type}</p>
              <p>Free cancellation</p>
              <p>You can cancel later,so lock in this great price today</p>
            </div>
            <div>
              <p>
                {col.rate_text} <span> {col.rate}</span>
                {""}
              </p>
              <h5>{col.price}</h5>
              <p>Includes taxes and fees</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};
export default SearchList;
